import axios from 'axios';

export const fetchCharacter = async () => {
  const { data } = await axios.get('https://swapi.py4e.com/api/people/1/');
  if (data) {
    return data;
  }
};

export const getSpeciesName = async (urls) => {
  // axios
  //   .all(urls.map((url) => axios.get(url)))
  //   .then((data) => console.log('aaaaa', data));

  const data = await axios.all(urls.map((url) => axios.get(url)));
  if (data && data.length > 0) {
    data.map((it) => {
      return it.name;
    });
  }
};

export const getFilmName = async (url) => {
  const { data } = await axios.get(url);
  if (data && data.episode_id) {
    return data;
  }
};
